import React,{ useState } from "react";
import {Button, Link, DialogTitle, Dialog, DialogActions, DialogContent, DialogContentText} from '@material-ui/core/';

import showIcon from '../../Assets/Images/eye for password.png'

export default function Modal() {
  const [open, setOpen] = React.useState(false);
  const [currPwd, setcurrPwd] = useState("");
  const [newPwd, setnewPwd] = useState("");
  const [verifyPwd, setverifyPwd] = useState("");
  const [showValCurr, setshowValCurr] = useState(false);
  const [showValNew, setshowValNew] = useState(false);
  const [showValVer, setshowValVer] = useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const toggleShowCurr = (event) => {
    event.preventDefault()
    setshowValCurr(!showValCurr)
  }

  const toggleShowNew = (event) => {
    event.preventDefault()
    setshowValNew(!showValNew)
  }

  const toggleShowVerify = (event) => {
    event.preventDefault()
    setshowValVer(!showValVer)
  }

  return (
    <div>
        <div className="pwdLink">
            <Link onClick={handleClickOpen}>Change Password</Link>
        </div>
      <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">
          {"Change Password"}
        </DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
          <form>
      <label>
        <p>Current Password</p>
        <input
          type={showValCurr ? "text" : "password"}
          value={currPwd}
          onChange={e => setcurrPwd(e.target.value)}
        />
      </label>
      <button onClick={toggleShowCurr}>
        <img src={showIcon} />
      </button>
      <label>
        <p>New Password</p>
        <input
          type={showValNew ? "text" : "password"}
          value={newPwd}
          onChange={e => setnewPwd(e.target.value)}
        />
      </label>
      <button onClick={toggleShowNew}>
        <img src={showIcon} />
      </button>
      <label>
        <p>Verify Password</p>
        <input
            type={showValVer ? "text" : "password"}
            value={verifyPwd}
            onChange={e => setverifyPwd(e.target.value)}
        />
      </label>
      <button onClick={toggleShowVerify}>
        <img src={showIcon} />
      </button>
    </form>
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Disagree
          </Button>
          <Button onClick={handleClose} color="primary" autoFocus>
            Agree
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
